// SPDX-License-Identifier: MIT
pragma solidity ^0.6.0;
pragma experimental ABIEncoderV2;

import "./common/OrderStore.sol";
import "./common/Interfaces.sol";
import "./common/MixinAuthorizable.sol";


/*
限价单：指定挂单的价格和数量
(1) 如果价格未进入另一边的价格之内，就不用进行交易，否则需要进行吃单
(2) 吃单过程中，如果有外部AMM提供优质流动性，则要考虑将外部流动性纳入吃单过程，正常情况下需要先跟外部AMM成交，之后再吃挂单

市价单：指定输出的币数量以及期望获得的输入的币的最小数量
(1) 可算出期望交易的底线价格
*/ 

contract BoboPair is MixinAuthorizable, OrderStore, ReentrancyGuard {
    using SafeMath for uint256;

    uint256 public constant BasePercent = 10000;
    uint256 public constant BaseAmountIn = 1e9;

    IExchangeManager public exManager;
    IBoboFarmer public boboFarmer;

    address public factory;
    address public quoteToken;
    address public baseToken;
    uint256 public quoteTokenDecimals;
    uint256 public baseTokenDecimals;


    uint256 public constant OneDaySeconds = 24 * 3600;
    uint256 public startTime;
    uint256 public lastRecordTime;
    uint256 public volumnOf24Hours;
    uint256 public totalVolumn;
    uint256[] public volumnList;

    event SwapSuccess(address indexed owner, address indexed spender, uint value);

    constructor () public OrderStore() {  
        factory = msg.sender;
        addAuthorized(msg.sender);
        startTime = now;
        lastRecordTime = startTime;
    }

    // called once by the factory at time of deployment
    function initialize(address _quoteToken, address _baseToken, address _authAddr, address _boboFarmer, address _orderNFT) external onlyOwner {
        quoteToken = _quoteToken;
        baseToken = _baseToken;
        quoteTokenDecimals = ERC20(quoteToken).decimals();
        baseTokenDecimals = ERC20(baseToken).decimals();
        addAuthorized(_authAddr);
        boboFarmer = IBoboFarmer(_boboFarmer);
        orderNFT = IOrderNFT(_orderNFT);
    }

    function setExManager(address _exManager) external onlyAuthorized {
        exManager = IExchangeManager(_exManager);
    }

    function getTokens() view public returns(address, address) {
        return (quoteToken, baseToken);
    }

    // 限价单，先吃单，再同AMM进行交易，剩下的部分挂限价单
    // _spotPrice: 以U为单位，如1000000表示下单价格为1U
    function addLimitedOrder(address _boboRouter, bool _bBuyQuoteToken, uint256 _spotPrice, uint256 _amountIn) public nonReentrant {
        require(exManager.routerWhiteList(_boboRouter), "BoboPair: router NOT in whitelist!");
        (address inToken, address outToken) = _bBuyQuoteToken ? (baseToken, quoteToken) : (quoteToken, baseToken);
        ERC20(inToken).transferFrom(msg.sender, address(this), _amountIn);

        uint256 minOutAmount = 0;
        if (_bBuyQuoteToken) {
            minOutAmount = _amountIn.mul(10**quoteTokenDecimals).div(_spotPrice);
        } else {
            minOutAmount = _amountIn.mul(_spotPrice).div(10**quoteTokenDecimals);
        }

        // 判断是否满足最小下单量
        require(_amountIn >= exManager.tokenMinAmountMap(inToken), "BoboPair: inAmount MUST larger than min amount.");

        uint256 orderId = addOrder(0, _bBuyQuoteToken, _spotPrice, _amountIn, minOutAmount);

        (uint256 leftAmountIn, uint256 totalAmountOut) = swap(_boboRouter, _bBuyQuoteToken, inToken, outToken, _spotPrice, _amountIn, minOutAmount, true);
        if (leftAmountIn == 0) {
            setDealedOrder(orderId, totalAmountOut);
        } else {
            uint256 dealedAmountIn = _amountIn.sub(leftAmountIn);
            uint256 childOrderId = addOrder(orderId, _bBuyQuoteToken, _spotPrice, dealedAmountIn, minOutAmount.mul(dealedAmountIn).div(_amountIn));
            setDealedOrder(childOrderId, totalAmountOut);
            orderNFT.updateOrderAmount(orderId, leftAmountIn, minOutAmount.sub(totalAmountOut));
        }
    }

    // 市价单，先匹配挂单，再同AMM进行交易，满足最小数量便成功，否则交易失败
    function addMarketOrder(address _boboRouter, bool _bBuyQuoteToken, uint256 _amountIn, uint256 _minOutAmount) public nonReentrant {
        (address inToken, address outToken) = _bBuyQuoteToken ? (baseToken, quoteToken) : (quoteToken, baseToken);
        require(_minOutAmount >= 0, "BoboPair: _minOutAmount should be > 0.");
        require(_amountIn >= exManager.tokenMinAmountMap(inToken), "BoboPair: inAmount MUST larger than min amount.");
        require(exManager.routerWhiteList(_boboRouter), "BoboPair: router NOT in whitelist!");
        ERC20(inToken).transferFrom(msg.sender, address(this), _amountIn);  // event 1

        // 扣maker手续费
        uint256 deductAmount = exManager.deductTradeFee(msg.sender, inToken, _amountIn);
        if (deductAmount > 0) {
            ERC20(inToken).transfer(address(exManager), deductAmount);   // event 2
        }
        _amountIn = _amountIn.sub(deductAmount);      

        // 生成订单
        uint256 spotPrice = _bBuyQuoteToken ? _amountIn.mul(10**quoteTokenDecimals).div(_minOutAmount) : _minOutAmount.mul(10**quoteTokenDecimals).div(_amountIn);
        uint256 orderId = addOrder(0, _bBuyQuoteToken, spotPrice, _amountIn, _minOutAmount);  // event 3

        (uint256 leftAmountIn, uint256 totalAmountOut) = swap(_boboRouter, _bBuyQuoteToken, inToken, outToken, spotPrice, _amountIn, _minOutAmount, false);

        if (leftAmountIn == 0) {
            setDealedOrder(orderId, totalAmountOut);
        } else {
            uint256 dealedAmountIn = _amountIn.sub(leftAmountIn);
            orderNFT.updateOrderAmount(orderId, dealedAmountIn, totalAmountOut);
            setDealedOrder(orderId, totalAmountOut);
        }
    }

    function swap(address _boboRouter, bool _bBuyQuoteToken,
                  address _inToken, address _outToken, uint256 _spotPrice,
                  uint256 _amountIn, uint256 _minOutAmount, bool _bLimitedOrder) private returns(uint256, uint256) {
        // 1：获取外部流动性价格
        uint256 amountOut = IBoboRouter(_boboRouter).getBaseAmountOut(_inToken, _outToken, _amountIn);

        // 当外部流动性满足交易条件时，进行交易
        if (amountOut >= _minOutAmount) {
            uint256 outTokenAmount = ERC20(_outToken).balanceOf(address(this));

            ERC20(_inToken).approve(_boboRouter, _amountIn);  
            IBoboRouter(_boboRouter).swap(_inToken, _outToken, _amountIn, _minOutAmount);

            uint256 totalAmountOut = ERC20(_outToken).balanceOf(address(this)).sub(outTokenAmount);   // 兑换出来的outToken数量
            require(totalAmountOut >= _minOutAmount, "BoboPair: the amount of outToken is NOT enough!");

            ERC20(_outToken).transfer(msg.sender, totalAmountOut);
            return (0, totalAmountOut);
        } else {  // 否则，同对手方进行交易
            (uint256 leftAmountIn, uint256 totalAmountOut) = batchMatchOrders(_bBuyQuoteToken, _spotPrice, _amountIn, _minOutAmount);
            if (leftAmountIn > 0) {
                if (_bLimitedOrder) {
                    if (leftAmountIn > 0 && boboFarmer.tokenPidMap(_inToken) > 0) {
                        ERC20(_inToken).approve(address(boboFarmer), leftAmountIn);
                        boboFarmer.deposit(_inToken, msg.sender, leftAmountIn);
                    }
                } else {
                    ERC20(_inToken).transfer(msg.sender, leftAmountIn);
                }
            }
            return (leftAmountIn, totalAmountOut);
        }
    }  

    function batchMatchOrders(bool bBuyQuoteToken, uint256 spotPrice, uint256 amountIn, uint256 minAmountOut) private returns(uint256, uint256) {        
        uint256 orderNumber = getTotalOrderNumber(!bBuyQuoteToken);
        uint256 leftAmountIn = amountIn;   // 剩余可兑换的资金
        uint256 swappedOutTokenAmount = 0;  // 被兑换出来的资金
        for (uint256 fromIndex = 0; fromIndex < orderNumber; fromIndex += 1) {            
            OrderInfo[] memory orderInfos = getOrderInfos(!bBuyQuoteToken, fromIndex, fromIndex + 1);

            if ((bBuyQuoteToken && spotPrice >= orderInfos[0].spotPrice) || (!bBuyQuoteToken && spotPrice <= orderInfos[0].spotPrice)) {  // 匹配价格满足条件的挂单
                (uint256 onceSwappedInTokenAmount, uint256 onceSwappedOutTokenAmount) = matchOrder(orderInfos[0], leftAmountIn);
                leftAmountIn = leftAmountIn.sub(onceSwappedInTokenAmount);
                swappedOutTokenAmount = swappedOutTokenAmount.add(onceSwappedOutTokenAmount);
                if (swappedOutTokenAmount >= minAmountOut || leftAmountIn == 0) {
                    break;
                }
            } else {
                break;
            }
        }
        return (leftAmountIn, swappedOutTokenAmount);
    }

    function matchOrder(OrderInfo memory hangingOrderInfo, uint256 leftAmountIn) private returns(uint256, uint256) {                            
        uint256 maxOutAmountExpected = getMaxOutAmountExpected(hangingOrderInfo.id);
        (address inToken, address outToken) = !hangingOrderInfo.bBuyQuoteToken ? (baseToken, quoteToken) : (quoteToken, baseToken);
        uint256 preInTokenBalance = ERC20(inToken).balanceOf(address(this));
        uint256 preSwappedOutTokenAmount = ERC20(outToken).balanceOf(address(this));

        if (leftAmountIn >= maxOutAmountExpected) {  // 输入的inToken数量满足当前挂单所需，可以完全吃掉此订单
            swapTokensForExactTokens(hangingOrderInfo, inToken, outToken, maxOutAmountExpected, maxOutAmountExpected);
        } else {  // 无法完全吃掉此订单，只能吃一部分
            swapTokensForExactTokens(hangingOrderInfo, inToken, outToken, leftAmountIn, maxOutAmountExpected);
        }

        uint256 newSwappedOutTokenAmount = ERC20(outToken).balanceOf(address(this));   // 兑换后本合约总的outToken
        uint256 swappedOutTokenBalance = newSwappedOutTokenAmount.sub(preSwappedOutTokenAmount);  // 兑换出来的token

        uint256 newInTokenBalance = ERC20(inToken).balanceOf(address(this));  // 兑换后剩余的inToken
        uint256 swappedInTokenBalance = newInTokenBalance.sub(preInTokenBalance);   // 兑换进去的token

        return (swappedInTokenBalance, swappedOutTokenBalance);
    }

    function swapTokensForExactTokens(OrderInfo memory orderInfo, address inToken, address outToken, uint256 outTokenAmountSwapIn, uint256 maxAmountSwapOut) private returns(uint256) {
        //(address inToken, address outToken) = orderInfo.bBuyQuoteToken ? (baseToken, quoteToken) : (quoteToken, baseToken);

        // 计算订单需要转出的inToken数量，此处使用maxAmountSwapOut，而不是orderInfo.minOutAmount，可以使挂单者获得不带滑点的收益
        uint256 inTokenAmountSwapOut = outTokenAmountSwapIn.mul(orderInfo.inAmount).div(maxAmountSwapOut);   

        uint256 tokenAmount4Fee = exManager.deductTradeFee(orderInfo.owner, inToken, inTokenAmountSwapOut);

        if (boboFarmer.tokenPidMap(inToken) > 0) {
            boboFarmer.withdraw(inToken, orderInfo.owner, inTokenAmountSwapOut);
        }
        if (tokenAmount4Fee > 0) {
            ERC20(inToken).transfer(address(exManager), tokenAmount4Fee);
        }
        uint256 amountIn = inTokenAmountSwapOut.sub(tokenAmount4Fee);

        // 将outToken给订单owner
        ERC20(outToken).transfer(orderInfo.owner, outTokenAmountSwapIn);

        // 将inToken转给msg.sender
        ERC20(inToken).transfer(msg.sender, amountIn);

        if(orderInfo.inAmount == inTokenAmountSwapOut) {   // 表示本订单的所有挂单金额都被吃完了
            setDealedOrder(orderInfo.id, outTokenAmountSwapIn);
        } else {
            uint256 childOrderId = addOrder(orderInfo.id, orderInfo.bBuyQuoteToken, orderInfo.spotPrice, inTokenAmountSwapOut, outTokenAmountSwapIn);
            setDealedOrder(childOrderId, outTokenAmountSwapIn);

            orderNFT.updateOrderAmount(orderInfo.id, orderInfo.inAmount.sub(inTokenAmountSwapOut), orderInfo.minOutAmount.sub(outTokenAmountSwapIn));  
        }

        makeStatistic(inToken == baseToken ? amountIn : outTokenAmountSwapIn);
        return outTokenAmountSwapIn;
    }    

    function makeStatistic(uint256 _amount) private {
        totalVolumn = totalVolumn.add(_amount);

        uint256 lastPeriod = lastRecordTime.sub(startTime).div(OneDaySeconds);
        uint256 currentPeriod = (now - startTime).div(OneDaySeconds);
        if (currentPeriod > lastPeriod) {
            volumnList.push(volumnOf24Hours);
            volumnOf24Hours = 0;
        }
        volumnOf24Hours = volumnOf24Hours.add(_amount);
        lastRecordTime = now;
    }

    function getCurrentPrice(address _boboRouter) view public returns(uint256) {
        uint256 amountOut = IBoboRouter(_boboRouter).getBaseAmountOut(baseToken, quoteToken, BaseAmountIn);
        uint256 spotPrice = BaseAmountIn.mul(10**quoteTokenDecimals).div(amountOut);
        return spotPrice;
    }

    function getTotalHangingTokenAmount(address _userAddr) view public returns(uint256 baseTokenAmount, uint256 quoteTokenAmount) {
        uint256 length = getUserHangingOrderNumber(_userAddr);
        for (uint256 i = 0; i < length; i++) {
            uint256 orderId = getUserHangingOrderId(_userAddr, i);
            OrderInfo memory orderInfo = orderNFT.getOrderInfo(orderId); 
            if (orderInfo.bBuyQuoteToken) {
                baseTokenAmount = baseTokenAmount.add(orderInfo.inAmount);
            } else {
                quoteTokenAmount = quoteTokenAmount.add(orderInfo.inAmount);
            }
        }
    }     

    // 获取此订单用户所期待的可兑换出的最多outToken数量
    function getMaxOutAmountExpected(uint256 _orderId) view public returns(uint256) {
        OrderInfo memory orderInfo = orderNFT.getOrderInfo(_orderId); 
        (address inToken, ) = orderInfo.bBuyQuoteToken ? (baseToken, quoteToken) : (quoteToken, baseToken);

        (uint256 tokenAmount4Fee,) = exManager.evaluateDeductedAmountIn(orderInfo.owner, inToken, orderInfo.inAmount);

        uint256 maxAmountSwapOut = orderInfo.bBuyQuoteToken ? orderInfo.inAmount.sub(tokenAmount4Fee).mul(10**quoteTokenDecimals).div(orderInfo.spotPrice) 
                                                            : orderInfo.inAmount.sub(tokenAmount4Fee).mul(orderInfo.spotPrice).div(10**quoteTokenDecimals);        
        return maxAmountSwapOut;
    }

    function cancelOrder(uint256 _orderId) public returns(bool) {
        setManualCancelOrder(_orderId); 

        OrderInfo memory orderInfo = orderNFT.getOrderInfo(_orderId); 
        address inToken = orderInfo.bBuyQuoteToken ? baseToken : quoteToken;
        if (boboFarmer.tokenPidMap(inToken) > 0) {
            boboFarmer.withdraw(inToken, orderInfo.owner, orderInfo.inAmount);
            ERC20(inToken).transfer(orderInfo.owner, orderInfo.inAmount);
        } else {
            ERC20(inToken).transfer(orderInfo.owner, orderInfo.inAmount);
        }
    }

}
